import React from 'react';
import './Header.css';
import logo from '../../assets/AmazingTech.png';
const Header = () => {
    return (
        
        <header className="header">
            <img src={logo} alt="AmazingTech" className="logo" />
            <nav>
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/admin">Admin Panel</a></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
